import java.util.Scanner;

public class MouseAndCheese {
    static int mouseRow;
    static int mouseCol;
    static int eatenCheese;
    static boolean indexIsOutOfBounds = false;
    static boolean hasBonusMove = false;

    public static void main(String[] args) {
        Scanner scanner = new Scanner(System.in);
        int mouseTerritory = Integer.parseInt(scanner.nextLine());
        char[][] matrix = readMatrix(scanner, mouseTerritory);
        String command = scanner.nextLine();

        while (!command.equals("end")) {
            switch (command) {
                case "up":
                    moveMouse(mouseRow - 1, mouseCol, matrix);
                    if (hasBonusMove) {
                        moveMouse(mouseRow - 1, mouseCol, matrix);
                        hasBonusMove = false;
                    }
                    break;
                case "down":
                    moveMouse(mouseRow + 1, mouseCol, matrix);
                    if (hasBonusMove) {
                        moveMouse(mouseRow + 1, mouseCol, matrix);
                        hasBonusMove = false;
                    }
                    break;
                case "left":
                    moveMouse(mouseRow, mouseCol - 1, matrix);
                    if (hasBonusMove) {
                        moveMouse(mouseRow, mouseCol - 1, matrix);
                        hasBonusMove = false;
                    }
                    break;
                case "right":
                    moveMouse(mouseRow, mouseCol + 1, matrix);
                    if (hasBonusMove) {
                        moveMouse(mouseRow, mouseCol + 1, matrix);
                        hasBonusMove = false;
                    }
                    break;
            }
            if (indexIsOutOfBounds) {
                break;
            }
            command = scanner.nextLine();
        }
        if (indexIsOutOfBounds) {
            System.out.println("Where is the mouse?");
        }
        if (eatenCheese < 5) {
            System.out.printf("The mouse couldn't eat the cheeses, she needed %d cheeses more.%n", 5 - eatenCheese);
        } else {
            System.out.printf("Great job, the mouse is fed %d cheeses!%n", eatenCheese);
        }
        printMatrix(matrix);
    }

    private static void printMatrix(char[][] matrix) {
        for (char[] chars : matrix) {
            for (char aChar : chars) {
                System.out.print(aChar);
            }
            System.out.println();
        }
    }

    private static void moveMouse(int row, int col, char[][] matrix) {
        if (!isValidIndex(row, col, matrix)) {
            matrix[mouseRow][mouseCol] = '-';
            indexIsOutOfBounds = true;
            return;
        }

        if (matrix[row][col] == 'c') {
            eatenCheese++;
        } else if (matrix[row][col] == 'B') {
            hasBonusMove = true;
        }

        matrix[mouseRow][mouseCol] = '-';
        mouseRow = row;
        mouseCol = col;
        matrix[mouseRow][mouseCol] = 'M';
    }

    private static char[][] readMatrix(Scanner scanner, int mouseTerritory) {
        char[][] matrix = new char[mouseTerritory][mouseTerritory];
        for (int row = 0; row < mouseTerritory; row++) {
            String input = scanner.nextLine();
            matrix[row] = input.toCharArray();
            if (input.contains("M")) {
                mouseRow = row;
                mouseCol = input.indexOf("M");
            }
        }
        return matrix;
    }

    public static boolean isValidIndex(int row, int col, char[][] matrix) {
        return row >= 0 && row < matrix.length && col >= 0 && col < matrix.length;
    }
}

