bool fits(int x, int y, Size size, std::vector<std::vector<bool>> occupied){
    try{
        for(int i = x; i < x + size.x; i++){
            for(int j = y; j < y + size.y; j++){
                if(occupied.at(j).at(i)) return false;
            }
        }
    }
    catch (const std::out_of_range& e) {
        return false;
    }
    return true;
}

