    for(int i = 2; i < 7; i += 4){
        for(int j = 1; j < 8; j += 4){
            sizes.push_back(Size(i, j));
        }
    }
    
    for(int i = 0; i < 15; i++){
        sizes.push_back(Size(1, 1));
    }

    
    std::sort(sizes.begin(), sizes.end(),
        [](const Size &a, const Size &b){
            return a.x * a.y > b.x * b.y;
        }
    );
    
    int area = 0;
    for(auto size: sizes){
        area += size.x * size.y;
    }
    
    
    int width = (int)(std::sqrt(area) * 1.3);
    int height = width;
    printf("area: %d\n", area);
